import React from 'react';

const PostCard = () => {
  return (
    <div>
      <Card>
        <Image/>
        <Content/>
        <Buttons></Buttons>
      </Card>
      <CommentForm/>
      <Comments/>
    </div>
  )
}
export default PostCard;
